INSERT INTO `activity` (`activityID`, `activityName`, `description`, `courseID`, `priorityFlag`, `localID`, `syncDate`, `durationInDays`) VALUES
(132, 'Subscribe to Technology news feeds', 'Within feedly and Flipboard subscribe to the various feeds such as Android, Java, Tech etc. Follow your nose or speak to an Instructor', 34, 2, 0, NULL, 0),
(133, 'Present Interesting Topics found', 'Every trainee will be required, from time to time, to present news and developments they find interesting and explain why the rest of the team should listen up.', 34, 3, 0, NULL, 0),
(134, 'Set up News Readers: Feedly and Flipboard', 'It is mandatory to install these news aggregators on both your laptop and mobile device. This is the best way to keep in touch with developments in the industry that might impact your project or your startup ideas.', 34, 1, 0, NULL, 0),
(135, 'Discussion of CodeTribe Code of Conduct', 'The CodeTribe Code of Conduct is a pact between and amongst all CodeTribe participants. It is a simple list of behaviours and expectations that bind every one of the people of CodeTribe. Foremost among those is the idea that knowledge should be shared, that knowledge is made more powerful if we all have it.', 35, 1, 0, NULL, 0),
(136, 'Read and sign Code of Coduct document', 'Prick your finger with a needle or other sharp object and sign this document with your blood. :-) Just kidding!', 35, 2, 0, NULL, 0),
(137, 'Trainee Skills Assessment', 'This assessment looks at the Trainee''s current skills in terms of the CodeTribe requirements and assigns a skill level to each skill type.', 36, 2, 0, NULL, 0),
(138, 'Network Configuration and Testing', 'Ensure that all equipment can connect to the class WIFI network and can see other devices. Check download performance.', 36, 3, 0, NULL, 0),
(139, 'Create Teams based on skills, project, etc.', 'Teams with similar skill levels will be grouped together for purposes of facilitating instruction. Teams will form and disband as circumstances and proficiency change.', 36, 1, 0, NULL, 0),
(140, 'Equipment Unboxing', 'Happiness. Everybody gets their hands on something new or something cool!', 36, 4, 0, NULL, 0),
(141, 'Install CourseMaker Administrator App', 'Someone is needed to keep an eye on the place. That honour falls to the Administrator. This is the first app in the suite and sets everything else up. For example, new Trainees and Instructors get registered via this app.', 37, 2, 0, NULL, 0),
(142, 'Install CourseMaker Instructor App', 'This app is installed and operated by CodeTribe Instructors and provides these guys and girls an interface to track class activities and perform rating and monitoring functions.', 37, 3, 0, NULL, 0),
(143, 'Install CourseMaker Author App', '"This app is installed and operated by CodeTribe Authors who create and work with the content of the activities that are the ""curriculum"" of the CodeTribe Academy."', 37, 5, 0, NULL, 0),
(144, 'Install CourseMaker ServerProbe App', 'A little that monitors the back end application and catches all the errors thrown up by the other Android apps in the wild.', 37, 6, 0, NULL, 0),
(145, 'Discussion on rationale and purpose of CourseMaker', 'Discussion in more detail on the use of the CourseMaker suite particularly its use as hands-on material for advanced topics', 37, 1, 0, NULL, 0),
(146, 'Install CourseMaker Trainee App', 'This app is installed and operated by the Trainee to track activity completion and performance and to provide a quite way to scream for help! The set of training units and associated activities are listed and marked when completed and performance rated.', 37, 4, 0, NULL, 0),
(147, 'Download and Install Java SDK', 'The Java SE SDK is the base foundation upon which some of the other elements of the toolchain depend. This SDK has to be installed on your development machine before any of the others.', 38, 2, 0, NULL, 0),
(148, 'Download and Install NetBeans', 'The Netbeans IDE will be used in the development of the Java based cloud back-end application', 38, 3, 0, NULL, 0),
(149, 'Download and Install Android Studio', 'The Android Studio IDE has been declared the official, standard development environment by Google and this is the IDE that is used in CodeTribe for all Android and Google Cloud Platform applications. ', 38, 4, 0, NULL, 0),
