(756, 'Discussion of CodeTribe Code of Conduct', 'The CodeTribe Code of Conduct is a pact between and amongst all CodeTribe participants. It is a simple list of behaviours and expectations that bind every one of the people of CodeTribe. Foremost among those is the idea that knowledge should be shared, that knowledge is made more powerful if we all have it.', 181, 1, 0, NULL, 0),
(757, 'Read and sign Code of Coduct document', 'Prick your finger with a needle or other sharp object and sign this document with your blood. :-) Just kidding!', 181, 2, 0, NULL, 0),
(758, 'Trainee Skills Assessment', 'This assessment looks at the Trainee''s current skills in terms of the CodeTribe requirements and assigns a skill level to each skill type.', 182, 2, 0, NULL, 0),
(759, 'Equipment Unboxing', 'Happiness. Everybody gets their hands on something new or something cool!', 182, 4, 0, NULL, 0),
(760, 'Network Configuration and Testing', 'Ensure that all equipment can connect to the class WIFI network and can see other devices. Check download performance.', 182, 3, 0, NULL, 0),
(761, 'Create Teams based on skills, project, etc.', 'Teams with similar skill levels will be grouped together for purposes of facilitating instruction. Teams will form and disband as circumstances and proficiency change.', 182, 1, 0, NULL, 0),
(762, 'Install CourseMaker Administrator App', 'Someone is needed to keep an eye on the place. That honour falls to the Administrator. This is the first app in the suite and sets everything else up. For example, new Trainees and Instructors get registered via this app.', 183, 2, 0, NULL, 0),
(763, 'Install CourseMaker Instructor App', 'This app is installed and operated by CodeTribe Instructors and provides these guys and girls an interface to track class activities and perform rating and monitoring functions.', 183, 3, 0, NULL, 0),
(764, 'Install CourseMaker Author App', '"This app is installed and operated by CodeTribe Authors who create and work with the content of the activities that are the ""curriculum"" of the CodeTribe Academy."', 183, 5, 0, NULL, 0),
(765, 'Discussion on rationale and purpose of CourseMaker', 'Discussion in more detail on the use of the CourseMaker suite particularly its use as hands-on material for advanced topics', 183, 1, 0, NULL, 0),
(766, 'Install CourseMaker ServerProbe App', 'A little that monitors the back end application and catches all the errors thrown up by the other Android apps in the wild.', 183, 6, 0, NULL, 0),
(767, 'Install CourseMaker Trainee App', 'This app is installed and operated by the Trainee to track activity completion and performance and to provide a quite way to scream for help! The set of training units and associated activities are listed and marked when completed and performance rated.', 183, 4, 0, NULL, 0),
(768, 'Present Interesting Topics found', 'Every trainee will be required, from time to time, to present news and developments they find interesting and explain why the rest of the team should listen up.', 184, 3, 0, NULL, 0),
(769, 'Set up News Readers: Feedly and Flipboard', 'It is mandatory to install these news aggregators on both your laptop and mobile device. This is the best way to keep in touch with developments in the industry that might impact your project or your startup ideas.', 184, 1, 0, NULL, 0),
(770, 'Subscribe to Technology news feeds', 'Within feedly and Flipboard subscribe to the various feeds such as Android, Java, Tech etc. Follow your nose or speak to an Instructor', 184, 2, 0, NULL, 0),
(771, 'Download and Install WAMP', 'WAMP ', 185, 6, 0, NULL, 0),
(772, 'Introduction to Data Models', 'Data Models model the data that will be managed by your app or the cloud application involved. ', 185, 3, 0, NULL, 0),
(773, 'Download and Install MySQL Administrator', 'The Administrator contains all the tools required to administer and maintain your MySQL Database server on your machine', 185, 4, 0, NULL, 0),
(774, 'Download and Install MySQL Workbench', 'The Workbench helps you design and forward engineer your data models', 185, 5, 0, NULL, 0),
(775, 'Introduction to the Database Toolchain', 'An introduction to the database toolchain used on your local development machine. A quick start review of the different tools and a look at sample artifacts produced by the tools.', 185, 1, 0, NULL, 0),
(776, 'Download and Install MySQL', 'MySQL Database system is required for local development of cloud applications', 185, 2, 0, NULL, 0),
(777, 'Create first project in Google Developer Console', 'The project created is a container that allows you to select the Google API''s required and generate the API keys required by all the Android apps that connect to services via Google Play Services', 186, 0, 0, NULL, 0),
(778, 'Create Google Play Developer Account', 'This account is required to publish apps on Google Play. There is an annual charge of $25.', 186, 0, 0, NULL, 0),
(779, 'Register for Google Developer Account', 'This account is required to provide access to Google API''s for both Android and cloud applications. This account is free of charge.', 186, 0, 0, NULL, 0),
(780, 'Download and Install NetBeans', 'The Netbeans IDE will be used in the development of the Java based cloud back-end application', 187, 3, 0, NULL, 0),
(781, 'Introduction to the basic CodeTribe Developer Toolset', 'Discussion and analysis of the CodeTribe Developer Tools. It is necessary to understand the role of each of the selected IDE''s.', 187, 1, 0, NULL, 0),
(782, 'Download and Install Android Studio', 'The Android Studio IDE has been declared the official, standard development environment by Google and this is the IDE that is used in CodeTribe for all Android and Google Cloud Platform applications. ', 187, 4, 0, NULL, 0),
(783, 'Download and Install Android SDK', 'From within Android Studio, use the SDK Manager to download and install the latest version of the Android SDK', 187, 5, 0, NULL, 0),
(784, 'Download and Install Java SDK', 'The Java SE SDK is the base foundation upon which some of the other elements of the toolchain depend. This SDK has to be installed on your development machine before any of the others.', 187, 2, 0, NULL, 0),
(785, 'Download and Install FileZilla', 'A File Transfer Protocol (FTP) client for uploading and downloading application files from your development machine to back-end cloud servers.', 187, 6, 0, NULL, 0),
(786, 'Create Sample BackEnd application', 'Copy supplied back end source code for the Proximity application. Install the web application on your local machine and start it', 188, 3, 0, NULL, 0),
(787, 'Using Proximity Application Suite', 'The Proximity suite of applications is used to certify that the major componens of your development environment are properly installed and working. Proximity consists of a back end database, business and gateway logic as well as two Android apps and a set of Bluetooth LE beacons.', 188, 5, 0, NULL, 0),
(788, 'Create Sample Android Application', 'Install Proximity CMS and Proximity Consumer apps on your Android smartphone', 188, 4, 0, NULL, 0),
(789, 'Introduction to Java Enterprise Edition (Java EE)', 'Introduction to Java EE will cover the major components of the enterprise services environment with focus on how it supports local development of your cloud based applications. The Netbeans IDE to create and work with Java EE applications.', 188, 1, 0, NULL, 0),
