(826, 'Activities', 'An activity is a single, focused thing that the user can do. Almost all activities interact with the user, so the Activity class takes care of creating a window for you in which you can place your UI withsetContentView(View).', 195, 2, 0, NULL, 0),
(827, 'Android User Interface XML', NULL, 195, 4, 0, NULL, 0),
(828, 'Fragments', '"AFragmentrepresents a behavior or a portion of user interface in anActivity. You can combine multiple fragments in a single activity to build a multi-pane UI and reuse a fragment in multiple activities. You can think of a fragment as a modular section of an activity, which has its own lifecycle, receives its own input events, and which you can add or remove while the activity is running (sort of like a ""sub activity"" that you can reuse in different activities)"', 195, 6, 0, NULL, 0),
(829, 'Introduction to the Android Architecture', 'An introduction to the major components of the Android system. A review of the components necessary to compose an Android app and how they relate to each other.', 195, 7, 0, NULL, 0),
(830, 'Adapters', 'An Adapter object acts as a bridge between anAdapterViewand the underlying data for that view. The Adapter provides access to the data items. The Adapter is also responsible for making aViewfor each item in the data set.', 195, 3, 0, NULL, 0),
(831, 'Fragments defined in activity layout xml', NULL, 195, 8, 0, NULL, 0),
(832, 'Reading Assignment - Devices', 'Android powers hundreds of millions of phones, tablets, and other devices in a wide variety of screen sizes and form factors. By taking advantage of Android''s flexible layout system, you can create apps that gracefully scale from large tablets to smaller phones.', 196, 0, 0, NULL, 0),
(833, 'Reading Assignment - Style', 'Style refers to the ability to customize the look and feel of user interface elements to create compelling and dynamic apps.', 196, 0, 0, NULL, 0),
