(836, 'The Android ActionBar', 'The action bar is one of the most important design elements you can implement for your app''s activities. Although first introduced with API level 11, you can use the Support Library to include the action bar on devices running Android 2.1 or higher.', 197, 0, 0, NULL, 0),
(837, 'Interacting with other Apps', 'How to build a user experience that leverages other apps available on the device to perform advanced user tasks, such as capture a photo or view an address on a map', 197, 0, 0, NULL, 0),
(838, 'Building a dynamic UI with Fragments', 'How to build a user interface for your app that is flexible enough to present multiple UI components on large screens and a more constrained set of UI components on smaller screensessential for building a single APK for both phones and tablets.', 197, 0, 0, NULL, 0),
