INSERT INTO `course` (`courseID`, `companyID`, `dateUpdated`, `activeFlag`, `categoryID`, `courseName`, `description`, `shareFlag`, `localID`, `syncDate`, `priorityFlag`) VALUES
(34, 1, '2014-08-03 03:02:36', 0, 15, 'Keeping Abreast of Technology Industry', 'Technology changes every day. You have to know what''s going on, what''s coming up! Knowledge of the industry is a paramount requirement so that you make your plans and projects with a solid foundation', 0, 0, NULL, 1),
(35, 1, '2014-08-03 03:02:37', 0, 15, 'CodeTribe Code of Conduct', 'The set of principles and expected behaviours for all CodeTribe participants', 0, 0, NULL, 2),
(36, 1, '2014-08-03 03:02:37', 0, 15, 'CodeTribe Teams', 'Teams of trainees that will for form for specific purposes and be disbanded when appropriate. The idea is that teams', 0, 0, NULL, 3),
(37, 1, '2014-08-03 03:02:37', 0, 15, 'CourseMaker Suite of Apps', '"CourseMaker is a suite of Android apps together with a cloud based back-end application that manages a near real-time management and monitoring of people training projects. Within CodeTribe the apps are used for a dual purpose', 0, 0, NULL, 4),
(38, 1, '2014-08-03 14:03:59', 0, 21, 'Integrated Development Environments (IDE)', 'IDE''s are the bedrock tools in the developer''s toolchain. They make it easier and more productive to write, test, debug and deploy code to mobile devices and the cloud.', 0, 0, NULL, 3),
(39, 1, '2014-08-03 14:04:02', 0, 21, 'Database Toolchain', 'MySQL database is used to cater for the data storage needs of the back end cloud applications. This particular installation will be used as the database system for the development of cloud applications on your machine.', 0, 0, NULL, 1),
(40, 1, '2014-08-03 14:04:04', 0, 21, 'External Developer Accounts', 'These are accounts required by a developer to access services and API''s in the cloud as well as publish apps on the Google Play Store', 0, 0, NULL, 2),
(41, 1, '2014-08-03 14:04:07', 0, 21, 'Tools Configuration and Testing', 'The activities in this unit are meant to certify that all the major components are properly installed and operable on the individual developer machine, the network as well as the mobile device. ', 0, 0, NULL, 4),
(42, 1, '2014-08-23 11:35:37', 0, 22, 'Introduction to Cloud Computing', 'An introduction to the large and growing Cloud Computing ecosystem. It is important to understand the impact that Cloud Computing has made on the technology industry as a whole and why it is crucial to get your head around and arms around it.', 0, 0, NULL, 1),
(43, 1, '2014-08-23 11:35:38', 0, 22, 'Cloud Database Implementation', NULL, 0, 0, NULL, 1),
(44, 1, '2014-08-23 11:35:38', 0, 22, 'The Java EE Servlet as mobile gateway', NULL, 0, 0, NULL, 2),
