(140, 49, '2014-09-02 12:33:12', 0, 45, 'CodeTribe Teams', 'Teams of trainees that will for form for specific purposes and be disbanded when appropriate. The idea is that teams', 0, 0, NULL, 3),
(141, 49, '2014-09-02 12:33:12', 0, 45, 'CourseMaker Suite of Apps', '"CourseMaker is a suite of Android apps together with a cloud based back-end application that manages a near real-time management and monitoring of people training projects. Within CodeTribe the apps are used for a dual purpose', 0, 0, NULL, 4),
(142, 49, '2014-09-02 12:33:12', 0, 45, 'Keeping Abreast of Technology Industry', 'Technology changes every day. You have to know what''s going on, what''s coming up! Knowledge of the industry is a paramount requirement so that you make your plans and projects with a solid foundation', 0, 0, NULL, 1),
(143, 49, '2014-09-02 12:33:12', 0, 46, 'Database Toolchain', 'MySQL database is used to cater for the data storage needs of the back end cloud applications. This particular installation will be used as the database system for the development of cloud applications on your machine.', 0, 0, NULL, 1),
(144, 49, '2014-09-02 12:33:12', 0, 46, 'External Developer Accounts', 'These are accounts required by a developer to access services and API''s in the cloud as well as publish apps on the Google Play Store', 0, 0, NULL, 2),
(145, 49, '2014-09-02 12:33:12', 0, 46, 'Integrated Development Environments (IDE)', 'IDE''s are the bedrock tools in the developer''s toolchain. They make it easier and more productive to write, test, debug and deploy code to mobile devices and the cloud.', 0, 0, NULL, 3),
(146, 49, '2014-09-02 12:33:12', 0, 46, 'Tools Configuration and Testing', 'The activities in this unit are meant to certify that all the major components are properly installed and operable on the individual developer machine, the network as well as the mobile device. ', 0, 0, NULL, 4),
